      | 48496 -> { ItemTypeData.id= 48496; name= "Claw Dawn of Liberation SKIN"; published= true; description= "The Great Rebellion was the dawn of liberation for the Minmatar tribes that once lived almost entirely under the dominion of the Amarr. When the slave revolt broke out in 20 BYC (AD 23216), it stunned an Amarr Empire already reeling from the shock of their defeat by the Jovian fleet at the Battle of Vak'Atioth.    The Minmatar that rose up were quickly able to cut a swathe through the territories surrounding the Matari home worlds, aided by groups of free Minmatar who had long operated as guerilla fighters both planet-side and in space. The Minmatar Republic was founded by four of the great tribes and was invited to join in the foundation of CONCORD in 3 BYC. By the end of YC 111, the Nefantar, Starkmanir and Thukker Tribes had rejoined their Brutor, Krusual, Sebiestor and Vherokior brothers and sisters in the Minmatar's Tribal Republic."; marketGroupId= Some(2062); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 48593 -> { ItemTypeData.id= 48593; name= "Slaver Tooth Necklace"; published= true; description= "This cord of yellowish fangs is typical of many with a claimed history of being the spoils from raids on Amarr slave camps, the story going that the necklace is formed of teeth from the Slaver Hounds killed during such raids.    Far from the effects of decay, the teeth have not fared well since parting with their owner. A scattering of little notch marks suggests they were forcibly removed – perhaps hurriedly or the creature they came from was in its death throes at the time. (The idea that anyone would try to remove the teeth from a Slaver Hound short of being mortally wounded seems far-fetched.)    The varying sizes of the teeth offer little clue to whether they came from one creature or many. However, their immense length, some as long as seven centimeters, does indeed point to the Amarr slaveholders' favored Syrikos Hound as a likely source."; marketGroupId= Some(1661); groupId= 1194; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
